import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

class Info extends React.Component {
    constructor(props){
      super(props)
    }

    render() {
        if(this.props.data.selectedCities.length > 2) {
            return (
                <div>
                    <TemperatureGraph data={this.props.data}/>
                </div>
            )
        } else {
            return null
        }   
    }
}
export default Info
